            strokeLinejoin="round"
            strokeWidth="24"
          />
        </>
      );
    case "duotone":
      return (
        <>
          <path
            d="M136,216V184a48,48,0,0,1,48-48h32C208,160,160,208,136,216Z"
            opacity="0.2"
          />
          <g>
            <path
              d="M136,216H88a48,48,0,0,1-48-48V88A48,48,0,0,1,88,40h80a48,48,0,0,1,48,48v48C208,160,160,208,136,216Z"
              fill="none"
